var jsonObject = JObject.Parse(CompanyJson);

JArray workers = (JArray)jsonObject["responsibleCaseworkers"];

for (int i = workers.Count - 1; i >= 0; i--)
        {
            JObject fruit = (JObject)workers[i];
            if ((string)fruit["caseworkerId"] == CaseworkerId)
            {
                workers.RemoveAt(i);
            }
        }

NewJson = workers.ToString(Formatting.Indented);
